import React from 'react';
import logo from './logo.svg';
import 'semantic-ui-css/semantic.min.css'
import FeedComponent from './Feed';
import FooterComponent from './Footer';
import './App.css';

function App() {
  return (
    <div >
      <header className="App-header">
        Header
      </header>
        <div className="feed">
            <FeedComponent />
        </div>
        <div>
            <FooterComponent />
        </div>
    </div>
  );
}

export default App;
